$(function() {
	'use strict'
		function showMenu() {
			var menu = $('.js-menu');
			var sidebar = $('.js-sidebar');
		
			menu.add(sidebar).on('click', function() {
				$(this).add(sidebar).toggleClass('is-active');
			});
		}
		
		showMenu();
	$(window).scroll(function() {
		var top = $(window).scrollTop();
		var isFixed =  $('.js-scroll').hasClass('is-fixed');
	
		if(top > 10 && !isFixed) {
			$('.js-scroll').addClass('is-fixed');
		} 
	
		if(top < 10 && isFixed) {
			$('.js-scroll').removeClass('is-fixed');
		}
	});
	//popup
	$('.js-open-popup').click(function(e) {
		e.preventDefault();
	
		var link = $(this).data('link');
		var popup = $('.js-popup[data-popup="' + link + '"]');
	
		popup.add('.js-overlay').addClass('is-active');
		$("body").addClass("is-hidden");
	
		console.log(popup, link);	
	});
	$(".js-close-popup").click(function (){
		$(this).parents(".js-popup").add('.js-overlay').removeClass('is-active');
		$("body").removeClass("is-hidden");
		return false;
	});
	
	$('.js-parallax-1').jKit('parallax', { 'strength': '0.4', 'axis': 'both', 'detect': 'mousemove' });
	$('.js-parallax-2').jKit('parallax', { 'strength': '0.15', 'axis': 'both', 'detect': 'mousemove' });
	$('#fullpage').fullpage({
		//Custom selectors
		sectionSelector: '.section',
		slideSelector: '.slide',
		scrollOverflow: true,
		verticalCentered: true,
	});
})
